import React, { useState, useEffect } from 'react';

function App() {
  // Initialize state
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [gender, setGender] = useState('');
  const [birthDate, setBirthDate] = useState('');

  // Function to open the modal
  const handleOpenModal = () => {
    setIsModalOpen(true);
  };

  // Function to close the modal
  const handleCloseModal = () => {
    setIsModalOpen(false);
  };

  // Function to handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();

    // Save player data to localStorage
    const playerData = {
      firstName,
      lastName,
      gender,
      birthDate,
    };

    localStorage.setItem('player', JSON.stringify(playerData));

    // Clear the form after submission
    setFirstName('');
    setLastName('');
    setGender('');
    setBirthDate('');
    handleCloseModal();

    alert('Data player telah disimpan!');
  };

  // Retrieve player data from localStorage when the app loads
  useEffect(() => {
    const savedPlayerData = localStorage.getItem('player');
    if (savedPlayerData) {
      const player = JSON.parse(savedPlayerData);
      setFirstName(player.firstName);
      setLastName(player.lastName);
      setGender(player.gender);
      setBirthDate(player.birthDate);
    }
  }, []);

  return (
    <div className="App">
      {/* Navbar */}
      <nav className="bg-blue-600 p-4">
        <div className="container mx-auto flex justify-between items-center">
          <h1 className="text-white text-xl font-bold">Login App</h1>
          <button
            onClick={handleOpenModal}
            className="text-white bg-green-500 px-4 py-2 rounded-md hover:bg-green-400"
          >
            Login
          </button>
        </div>
      </nav>

      {/* Modal */}
      {isModalOpen && (
        <div className="fixed inset-0 flex items-center justify-center bg-gray-900 bg-opacity-50">
          <div className="bg-white p-6 rounded-lg shadow-lg w-96">
            <div className='flex justify-between items-center'>
              <h2 className="text-2xl font-semibold mb-4">
                Login Form
                {/* Close Button */}
              </h2>
              <button
                onClick={handleCloseModal}
                className="text-red-500 hover:text-red-400"
              >
                Tutup
              </button>
            </div>

            <form onSubmit={handleSubmit}>
              <div className="mb-4 flex space-x-4">
                {/* Nama Depan */}
                <div className="flex-1">
                  <label htmlFor="firstName" className="block text-gray-700">Nama Depan</label>
                  <input
                    type="text"
                    id="firstName"
                    value={firstName}
                    onChange={(e) => setFirstName(e.target.value)}
                    className="w-full px-3 py-2 border border-gray-300 rounded-md"
                    required
                    placeholder="Masukkan nama depan"
                  />
                </div>

                {/* Nama Belakang */}
                <div className="flex-1">
                  <label htmlFor="lastName" className="block text-gray-700">Nama Belakang</label>
                  <input
                    type="text"
                    id="lastName"
                    value={lastName}
                    onChange={(e) => setLastName(e.target.value)}
                    className="w-full px-3 py-2 border border-gray-300 rounded-md"
                    required
                    placeholder="Masukkan nama belakang"
                  />
                </div>
              </div>

              {/* Gender (Select Dropdown) */}
              <div className="mb-4">
                <label htmlFor="gender" className="block text-gray-700">Gender</label>
                <select
                  id="gender"
                  value={gender}
                  onChange={(e) => setGender(e.target.value)}
                  className="w-full px-3 py-2 border border-gray-300 rounded-md"
                  required
                >
                  <option value="">Pilih Gender</option>
                  <option value="Laki-laki">Laki-laki</option>
                  <option value="Perempuan">Perempuan</option>
                </select>
              </div>

              {/* Tanggal Lahir */}
              <div className="mb-4">
                <label htmlFor="birthDate" className="block text-gray-700">Tanggal Lahir</label>
                <input
                  type="date"
                  id="birthDate"
                  value={birthDate}
                  onChange={(e) => setBirthDate(e.target.value)}
                  className="w-full px-3 py-2 border border-gray-300 rounded-md"
                  required
                />
              </div>

              {/* Submit Button */}
              <button
                type="submit"
                className="w-full bg-blue-500 text-white py-2 rounded-md hover:bg-blue-400"
              >
                Login
              </button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
